.row::after {
  content: "";
  clear: both;
  display: table;
}

[class*="col-"] {
  float: left;
}

//-----MIXINS

@mixin row-center {
	display: flex;
	flex-flow: row wrap;
	justify-content: center;
	align-items: center;
}

@mixin col-center {
	display: flex;
	flex-flow: col wrap;
	justify-content: center;
	align-items: center;
}

/*#endregion Scaffolding*/

/*#region Global Styling*/

//-----COLORS-----

$black: #000000;
$black-5: #0d0d0d;
$black-25: #404040;
$white: #ffffff;
$white-5: #f2f2f2;
$white-25: #bfbfbf;
$dark: #310404;
$dark-brown: #630404;
$red: #890e08;
$yellow: #fbbe08;
$orange: #eca104;
$dark-orange: #b05108;

