}

@mixin primary-font {
	color: $dark;
	font-family: $primary-font;
}

//All Elements Tag
* {
	box-sizing: border-box;
}

html {
  scroll-behavior: smooth;
}

//Header Wraps
header {
  display: visible;
}

//Main Title 
h1 {
	@include pirate-reg;
	font-size: calc(3rem + 3vmin);
	filter: drop-shadow(6px 6px 8px $dark);
	margin-block-start: 0;
	margin-block-end: 0;
	margin-inline-start: 0px;
